from tensorflow.keras import layers
import time

"""Functions to Pre-Process the input images"""

#function to normalize the images
def normalization(x, mean, std):
    return (x-mean)/std

#function to load the dataset (set of images from a painter/style we want to capture in entirety)
def load_dataset(path, width, height, mean, std):
    files = os.listdir(path)
    data = []
    for file in files:
        x = load_images(path+'/'+file, width, height, mean, std)
        data.append(x)
    return np.array(data)

#Function to load the content images-image we want to transform
def load_images(path, width, height, mean, std):
    x = tf.io.read_file(path)
    x = tf.image.decode_jpeg(x, channels=3)
    x = tf.image.resize(x, size=[height, width])
    x = x/255
    x = normalization(x, mean, std)
    x = tf.reshape(x, [1, height, width, 3])
    return x

#Function to save the transformed image
def save_image(image, path, mean, std):
    x = tf.reshape(image, image.shape[1:])
    x = x*std+mean
    x = x*255
    x = tf.clip_by_value(x,0,255)
    x = tf.cast(x,tf.uint8)
    x = tf.image.encode_jpeg(x)
    tf.io.write_file(path,x)

